import React, { useRef } from "react";
import axios from "axios";

const Comp10 = () => {
  let x1 = useRef();
  let x2 = useRef();
  let x3 = useRef();

  const handleClick = () => {
    axios
      .post("http://localhost:8080/add-product1", {
        name: x1.current.value,
        price: x2.current.value,
        discount: x3.current.value,
      })
      .then((res) => console.log(res.data))
      .catch((err) => console.log(err));
  };
  return (
    <div style={{ width: "500px", margin: "auto", marginTop: "50px" }}>
      <h1>Add Product</h1>
      <br />
      <div>
        <input
          type="text"
          className="form-control"
          placeholder="Name"
          ref={x1}
        />
      </div>
      <br />
      <div>
        <input
          type="number"
          className="form-control"
          placeholder="price"
          ref={x2}
        />
      </div>
      <br />
      <div>
        <input
          type="number"
          className="form-control"
          placeholder="discount"
          ref={x3}
        />
      </div>
      <br />
      <button type="submit" className="btn btn-primary" onClick={handleClick}>
        Submit
      </button>
    </div>
  );
};

export default Comp10;
